window.bookSummaryJSON = "<p><b>Knight</b></p> <p><i>Pain.</i><br> <i>Darkness.</i><br> That’s what my life is. Always has been.</p> <p>Koby is the opposite.<br> Light and redemption.</p> <p>She can see through to my tortured soul, see into the depths, the parts that want to torture her, remove the light from her eyes. Break her until she’s nothing just like me.</p> <p>She thinks she can save me. Like there is something left to be salvaged.<br> She has no idea I’m not the white knight in her story, there is no happily ever after for us.</p> <p><b>Koby</b></p> <p><i>He was born to hate me.</i><br> <i>I was born to hate him.</i><br> We are the modern-day Romeo and Juliet, both of us born into warring families.</p> <p>I see the pain, darkness behind his eyes.</p> <p>Will his darkness snuff out the light of my soul?<br> Or can I be the brightness that he so desperately needs?</p> <p>I’m no princess, but right now I need to be saved, and I’ve just found my Knight.</p>"; 
